DROP DATABASE IF EXISTS project;

CREATE DATABASE project;

DROP TABLE IF EXISTS project.viewing; 
DROP TABLE IF EXISTS project.Comment; 
DROP TABLE IF EXISTS project.Follow; 
DROP TABLE IF EXISTS project.Donate; 
DROP TABLE IF EXISTS project.Verification; 
DROP TABLE IF EXISTS project.Coin; 
DROP TABLE IF EXISTS project.ShelfHistory; 
DROP TABLE IF EXISTS project.Chapter; 
DROP TABLE IF EXISTS project.Novel;  
DROP TABLE IF EXISTS project.PenName; 
DROP TABLE IF EXISTS project.Category; 
DROP TABLE IF EXISTS project.Account;  

CREATE  TABLE project.Account( 
AccountID        int(10) 		   NOT NULL AUTO_INCREMENT, 
ShowName         text            	   NOT NULL, 
UserName           text                        NOT NULL, 
PassWord            text                        NOT NULL, 
Class   text    NOT NULL,
ProfileImage        BLOB                     NULL,  
AccountEmail      text                        NOT NULL, 
FirstName            text                        NOT NULL, 
LastName             text                        NOT NULL, 
Sex                         text                        NOT NULL, 
DateOfBirth         TIMESTAMP          NULL, 
Bank                      text                         NULL, 
BankNumber       Int(10)                    NULL,   
BankName           text                         NULL, 
Telephone            text                         NULL,  
Balance float(4) NULL,   
PRIMARY KEY(AccountID) 
);    

CREATE  TABLE project.Category( 
CategoryID 	Int(10)		NOT NULL AUTO_INCREMENT, 
CategoryName 	text 		NOT NULL, 
PRIMARY KEY(CategoryID) 
);    

CREATE  TABLE project.PenName( 
PenID	               Int(10)	          	NOT NULL AUTO_INCREMENT, 
AccountID           Int(10) 		NOT NULL, 
PenName	Varchar(50)      	NOT NULL, 
PRIMARY KEY(PenID), 
FOREIGN KEY(AccountID) 
REFERENCES Account(AccountID) 
);    

CREATE  TABLE project.Novel( 
NovelID 		Int(10)		NOT NULL AUTO_INCREMENT, 
NovelName 		text		NOT NULL, 
PenID 			Int(10)		NOT NULL, 
CategoryID 		Int(10)		NOT NULL , 
Rate 			boolean	NOT NULL , 
NovelStatus 		boolean	NOT NULL , 
PublishDateTime 	TIMESTAMP 	NOT NULL DEFAULT '2021-01-01 00:00:00', 
LastEditDateTime 	TIMESTAMP 	NOT NULL DEFAULT '2021-01-01 00:00:00', 
PRIMARY KEY(NovelID), 
FOREIGN KEY(PenID) 
REFERENCES PenName(PenID) ON DELETE CASCADE, 
FOREIGN KEY(CategoryID) 
REFERENCES Category(CategoryID) 
);    

CREATE  TABLE project.Chapter( 
NovelID	 		Int(10)		NOT NULL , 
ChapterNumber 	Int(3) 		NOT NULL, 
ChapterName 	text	NOT NULL, 
Story			text	 	NOT NULL, 
PRIMARY KEY(NovelID, ChapterNumber), 
FOREIGN KEY(NovelID)  
REFERENCES Novel(NovelID) ON DELETE CASCADE
);    

CREATE  TABLE project.Viewing( 
ViewID 			Int(10)		NOT NULL AUTO_INCREMENT, 
NovelID 		Int(10) 		NOT NULL, 
ChapterNumber 	Int(3)		NOT NULL, 
AccountID 		Int(10)		NOT NULL, 
ReadDateTime 		TIMESTAMP 	NOT NULL DEFAULT '2021-01-01 00:00:00', 
PRIMARY KEY(ViewID), 
FOREIGN KEY(AccountID) 
REFERENCES Account(AccountID) 
);    

CREATE  TABLE project.Comment( 
CommentID		Int(10)	     	NOT NULL AUTO_INCREMENT, 
ChapterNumber	Int(3) 		NOT NULL, 
NovelID			Int(10)		NOT NULL, 
AccountID		Int(10)	 	NOT NULL, 
CommentContent	text	 	NOT NULL, 
CommentTime		timestamp	NOT NULL DEFAULT '2021-01-01 00:00:00', 
PRIMARY KEY(CommentID), 
FOREIGN KEY(AccountID) 
REFERENCES ACCOUNT(AccountID) 
);    

CREATE  TABLE project.Follow( 
FollowID 		Int(10)			NOT NULL AUTO_INCREMENT, 
PenID 			Int(10) 			NOT NULL , 
AccountID 		Int(10)		 	NOT NULL , 
FollowDateTime	timestamp	  	NULL DEFAULT '2021-01-01 00:00:00', 
PRIMARY KEY(FollowID), 
FOREIGN KEY(PenID) 
REFERENCES PenName(PenID) ON DELETE CASCADE, 
FOREIGN KEY(AccountID) 
REFERENCES Account(AccountID) 
);     

CREATE  TABLE project.Donate( 
DonateNo 		Int(10)		NOT NULL AUTO_INCREMENT, 
DonateDateTime 	TIMESTAMP 	NOT NULL DEFAULT '2021-01-01 00:00:00', 
NovelID 		Int(10)		NOT NULL DEFAULT 0, 
AccountID 		Int(10)		NOT NULL , 
DonateAmount 		Int(4)	   	NOT NULL, 
PRIMARY KEY(DonateNo), 
FOREIGN KEY(NovelID) 
REFERENCES Novel(NovelID) ON DELETE CASCADE, 
FOREIGN KEY(AccountID) 
REFERENCES ACCOUNT(AccountID) 
);   

CREATE  TABLE project.Verification( 
AccountID 		Int(10)		NOT NULL , 
IDCardPic 		BLOB 		NOT NULL, 
SendDateTime 		TIMESTAMP 	NOT NULL DEFAULT '2021-01-01 00:00:00', 
AgeVerification 		boolean      NULL DEFAULT NULL, 
PRIMARY KEY(AccountID,SendDateTime), 
FOREIGN KEY(AccountID) 
REFERENCES ACCOUNT(AccountID) 
);    

CREATE  TABLE project.ShelfHistory( 
AccountID 		Int(10)		NOT NULL, 
NovelID 		Int(10)		NOT NULL, 
AddShelfDateTime 	timestamp	NOT NULL DEFAULT '2021-01-01 00:00:00', 
PRIMARY KEY(AccountID,NovelID), 
FOREIGN KEY(AccountID) 
REFERENCES Account(AccountID), 
FOREIGN KEY(NovelID) 
REFERENCES Novel(NovelID) ON DELETE CASCADE
);    

CREATE  TABLE project.Coin( 
TopUpNo 		Int(10)		NOT NULL AUTO_INCREMENT, 
TopUpDateTime 	timestamp	NOT NULL DEFAULT '2021-01-01 00:00:00', 
TopUpAmount 		float(4)	   	NOT NULL, 
PaymentType 		text 		NOT NULL, 
AccountID 		int(10) 		NOT NULL, 
PRIMARY KEY(TopUpNo), 
FOREIGN KEY(AccountID) 
REFERENCES Account(AccountID) 
);   

CREATE INDEX FK_CHN_IN ON project.Chapter(ChapterNumber);

ALTER TABLE project.Viewing ADD CONSTRAINT FK_CHN FOREIGN KEY (ChapterNumber) REFERENCES project.CHAPTER(ChapterNumber) ON DELETE CASCADE;

ALTER TABLE project.Viewing ADD CONSTRAINT FK_N FOREIGN KEY (NovelID) REFERENCES project.CHAPTER(NovelID) ON DELETE CASCADE;

ALTER TABLE project.Comment ADD CONSTRAINT FK_CHN2 FOREIGN KEY (ChapterNumber) REFERENCES project.CHAPTER(ChapterNumber) ON DELETE CASCADE;

ALTER TABLE project.Comment ADD CONSTRAINT FK_N2 FOREIGN KEY (NovelID) REFERENCES project.CHAPTER(NovelID) ON DELETE CASCADE;

